  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Okefenokee National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1950.
  The report begins by summarizing the weather conditions, water conditions, food
  and cover, and wildfires during this period. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, predators, raptors, fish, and reptiles-
  is also covered. The Refuge development and maintenance section discusses physical
  developments. A progress report on field investigations and applied research is
  also provided.The public relations section of the report describes recreational
  uses, Refuge visitors, hunting, fishing, and violations. Photographs and N-R forms
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
